import { obtenerEmpleadoPorId } from '../services/supa';

export const obtenerNombreEmpleado = async (idEmpleado) => {
    try {

        const empleado = await obtenerEmpleadoPorId(idEmpleado);
        
        if (empleado) {

            return {
                pnombre: empleado.pnombre,
                snombre: empleado.snombre,
                apaterno: empleado.apaterno,
                amaterno: empleado.amaterno
            };
        } else {
            return {};
        }
    } catch (error) {
        console.error('Error al obtener el nombre del empleado:', error);
        return {};
    }
};
